import React from "react";

const VideoList = (props) => {
    if (props.Response){
        const items = props.Response.data.items 

        const VideoItems = () => {
            console.log(items)
            const ImgLst = items.map(item => {
                return (
                    <div>
                        <img src= {item.snippet.thumbnails.default.url} />
                        <h1>Helloooo</h1>
                    </div>
                )
            })
        }

        return(
            <div>
                {ImgLst}
            </div>
            )
}
}


export default VideoList;
